package protobuf.message.messageProto;
import "protobuf/message/messageProto/Example.proto";
option java_package = "protobuf.message.messageClass";
option java_outer_classname = "OutTestMessage";

extend BaseData {
    optional TestMessage testMessage=1000;
}

message TestMessage{
    required string name=1;
    required int32 age=2;
    required int32 high=3;
}
